import React, { useState, useEffect } from 'react';

export default function UserPage() {
  // États pour gérer ressources, réservations, formulaire
  const [resources, setResources] = useState([]);
  const [myReservations, setMyReservations] = useState([]);
  const [selectedResource, setSelectedResource] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');

  // Charger les ressources disponibles au chargement
  useEffect(() => {
    fetchResources();
    fetchMyReservations();
  }, []);

  // Fonction pour récupérer les ressources
  const fetchResources = async () => {
    try {
      const res = await fetch('http://localhost:4000/api/resources');
      const data = await res.json();
      setResources(data);
    } catch (error) {
      alert('Erreur chargement ressources');
    }
  };

  // Fonction pour récupérer les réservations de l'utilisateur
  const fetchMyReservations = async () => {
    try {
      const res = await fetch('http://localhost:4000/api/myreservations'); // adapter l’url selon ton backend
      const data = await res.json();
      setMyReservations(data);
    } catch (error) {
      alert('Erreur chargement réservations');
    }
  };

  // Fonction pour faire une réservation
  const handleReserve = async () => {
    if (!selectedResource || !startDate || !endDate) {
      alert('Veuillez remplir tous les champs');
      return;
    }
    try {
      await fetch('http://localhost:4000/api/reservations', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          resourceId: selectedResource,
          start: startDate,
          end: endDate,
        }),
      });
      alert('Réservation demandée avec succès !');
      setSelectedResource('');
      setStartDate('');
      setEndDate('');
      fetchMyReservations();
    } catch {
      alert('Erreur lors de la réservation');
    }
  };

  return (
    <div style={{ maxWidth: 700, margin: 'auto', padding: 20 }}>
      <h1>Bienvenue sur votre espace utilisateur</h1>

      <h2>Faire une réservation</h2>
      <div style={{ marginBottom: 20 }}>
        <select
          value={selectedResource}
          onChange={(e) => setSelectedResource(e.target.value)}
          style={{ padding: 10, width: '100%', marginBottom: 10 }}
        >
          <option value="">-- Choisir une ressource --</option>
          {resources.map((r) => (
            <option key={r.id} value={r.id}>
              {r.name}
            </option>
          ))}
        </select>

        <input
          type="datetime-local"
          value={startDate}
          onChange={(e) => setStartDate(e.target.value)}
          style={{ padding: 10, width: '48%', marginRight: '4%' }}
        />
        <input
          type="datetime-local"
          value={endDate}
          onChange={(e) => setEndDate(e.target.value)}
          style={{ padding: 10, width: '48%' }}
        />

        <button
          onClick={handleReserve}
          style={{ marginTop: 10, padding: '10px 20px', cursor: 'pointer' }}
        >
          Réserver
        </button>
      </div>

      <h2>Mes réservations</h2>
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th>Ressource</th>
            <th>Début</th>
            <th>Fin</th>
            <th>Statut</th>
          </tr>
        </thead>
        <tbody>
          {myReservations.length === 0 && (
            <tr>
              <td colSpan={4} style={{ textAlign: 'center', padding: 20 }}>
                Vous n’avez aucune réservation.
              </td>
            </tr>
          )}
          {myReservations.map((res) => (
            <tr key={res.id}>
              <td>{res.resourceName}</td>
              <td>{new Date(res.start).toLocaleString()}</td>
              <td>{new Date(res.end).toLocaleString()}</td>
              <td>{res.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
